import { Link } from 'react-router-dom';

// Import Components
import Navbar from '../components/Navbar';
import Jumbotron from '../components/Jumbotron';

const Home = (props) => {
    return (
        <div>
            <Navbar brand="Arkcrud" />
            <Jumbotron>
                <h1 class="display-4 font font-weight-bold">Selamat Datang di Arkcrud!</h1>
                <hr class="my-4"></hr>
                <Link class="btn btn-primary btn-lg" to="#">Learn more</Link>
            </Jumbotron>
        </div>
    )
}

export default Home;
